work and processes of Scrum and how to utilize these structures to the max at your job!'),(312,8,'_add_certifieds_1_detail','field_5dccc269216ae'),(313,8,'add_certifieds_1_link','https://www.trendingagile.com/scrum-master-certification'),(314,8,'_add_certifieds_1_link','field_5dccc27d216af'),(315,8,'add_certifieds_1_image','211'),(316,8,'_add_certifieds_1_image','field_5dccc288216b0'),(317,8,'add_certifieds','3'),(318,8,'_add_certifieds','field_5dccc1e8216ac'),(319,8,'wt_heading','Trending Agile'),(320,8,'_wt_heading','field_5dccc2c09ead7'),(321,8,'wt_sub_heading','Welcome to'),(322,8,'_wt_sub_heading','field_5dccc2db9ead8'),(323,8,'wt_image','105'),(324,8,'_wt_image','field_5dccc2fe9ead9'),(325,8,'wt_details','Our training academy is set up in the heart of NoVA, dedicated to providing excellence in all types of Project Management certification training to ensure that you get the best for you and for your career. Our focus is on best practices and frameworks that can provide maximum ROI, in terms of understanding and career growth.\r\n\r\nOur trainings and services across SAFe, Scrum Master and PMP certifications are available all around the year with the added speciality of organizing in-house training and coaching if so required.\r\n\r\nOur trainers and coaches are all experts and have been in the field itself as parts of large and small organizations. They understand that there are multiple scenarios for each part of the certifications and they know that there is never an ideal situation. They work with everyone to prepare them for every scenario and how to optimize it as per each framework and methodology that you learn.'),(326,8,'_wt_details','field_5dccc30b9eada'),(327,8,'ct_label',''),(328,8,'_ct_label','field_5dccc3363b545'),(329,8,'ct_counter',''),(330,8,'_ct_counter','field_5dccc33e3b546'),(331,8,'add_testimonials','a:3:{i:0;s:2:\"34\";i:1;s:2:\"37\";i:2;s:2:\"38\";}'),(332,8,'_add_testimonials','field_5dccc36fa4509'),(333,98,'add_slides_0_heading','<span>