dccc0e6b20d7'),(3295,253,'add_slides_0_button_link','https://www.trendingagile.com/safe4-certificate/'),(3296,253,'_add_slides_0_button_link','field_5dccc10db20d8'),(3297,253,'add_slides_0_image','97'),(3298,253,'_add_slides_0_image','field_5dccc17282290'),(3299,253,'add_slides','2'),(3300,253,'_add_slides','field_5dccc0c6b20d4'),(3301,253,'add_certifieds_0_heading','SAFe Training and Certification'),(3302,253,'_add_certifieds_0_heading','field_5dccc249216ad'),(3303,253,'add_certifieds_0_detail','Enterprise level teams now look to Scaled Agile practices to maximize the benefit of large-scale projects that encompasses multiple teams. Learn the various skills, understand the mind-set and comprehend all the knowledge here at our SAFe Training. If you are unsure of where to start, we also provide guides on where to start that helps you best on your career path!'),(3304,253,'_add_certifieds_0_detail','field_5dccc269216ae'),(3305,253,'add_certifieds_0_link','https://www.trendingagile.com/safe4-certificate/'),(3306,253,'_add_certifieds_0_link','field_5dccc27d216af'),(3307,253,'add_certifieds_0_image','205'),(3308,253,'_add_certifieds_0_image','field_5dccc288216b0'),(3309,253,'add_certifieds_1_heading','Scrum Master Certification'),(3310,253,'_add_certifieds_1_heading','field_5dccc249216ad'),(3311,253,'add_certifieds_1_detail','Get THE Certification that will make you stand out as a true Scrum specialist. A 2-day course that will guide you through the framework and processes of Scrum and how to utilize these structures to the max at your job!'),(3312,253,'_add_certifieds_1_detail','field_5dccc269216ae'),(3313,253,'add_certifieds_1_link','https://www.trendingagile.com/scrum-master-certification'),(3314,253,'_add_certifieds_1_link','field_5dccc27d216af'),(3315,253,'add_certifieds_1_image','211'),(3316,253,'_add_certifieds_1_image','field_5dccc288216b0'),(3317,253,'add_certifieds','3'),(3318,253,'_add_certifieds','field_5dccc1e8216ac'),(3319,253,'wt_heading','Trending Agile'),(3320,253,'_wt_heading','field_5dccc2c09ead7'),(3321,253,'wt_sub_heading','Welcome to'),(3322,253,'_wt_sub_heading','field_5dccc2db9ead8'),(3323,253,'wt_image','105'),(3324,253,'_wt_image','field_5dccc2fe9ead9'),(3325,253,'wt_details','Our training academy is set up in the heart of NoVA, dedicated to providing excellence in all types of Project Management certification training to ensure that you get the best for you and for your career. Our focus is on best practices and frameworks that can provide maximum ROI, in terms of understanding and career growth.\r\n\r\nOur trainings and services across SAFe, Scrum Master and PMP certifications are available all around the year with the added speciality of organizing in-house training and coaching if so required.\r\n\r\nOur trainers and coaches are all experts and have been in the field itself as parts of large and small organizations. They understand that there are multiple scenarios for each part of the certifications and they know that there is never an ideal situation. They work with everyone to prepare them for every scenario and how to optimize it as per each framework and methodology that you learn.'),(3326,253,'_wt_details','field_5dccc30b9eada'),(3327,253,'ct_label',''),(3328,253,'_ct_label','field_5dccc3363b545'),(3329,253,'ct_counter',''),(3330,253,'_ct_counter','field_5dccc33e3b546'),(3331,253,'add_testimonials','a:3:{i:0;s:2:\"34\";i:1;s:2:\"37\";i:2;s:2:\"38\";}'),(3332,253,'_add_testimonials','field_5dccc36fa4509'),(3333,253,'add_slides_1_heading','<span>The</span> Certified Partner2'),(3334,253,'_add_slides_1_heading','field_5dccc0d6b20d5'),(3335,253,'add_slides_1_sub_heading','An opportunity to get the tools'),(3336,253,'_add_slides_1_sub_heading','field_5dccc0ddb20d6'),(3337,253,'add_slides_1_button_title','Get Certificate'),(3338,253,'_add_slides_1_button_title','field_5dccc0e6b20d7'),(3339,253,'add_slides_1_button_link','https://www.trendingagile.com/safe4-certificate/'),(3340,253,'_add_slides_1_button_