','',39,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/11/thumbnail_image-2.png',0,'attachment','image/png',0),(141,1,'2019-11-25 04:24:00','2019-11-25 04:24:00','','safe4 certificate','','inherit','closed','closed','','39-revision-v1','','','2019-11-25 04:24:00','2019-11-25 04:24:00','',39,'http://trendingagile.justcodeindia.com/2019/11/25/39-revision-v1/',0,'revision','',0),(142,1,'2019-11-25 04:24:41','2019-11-25 04:24:41','\"We at Trending Agile know that the world of SAFe and its multitude of certifications can be a tad difficult to handle. We know that you want the best for you without any diversions on your career path, which is why we have a roadmap here to make things easier for you. If you would like something more specific, you can always reach out to us and we will work with you to get you the best possible you that you can be.\r\n\r\nP.S. Remember if you ever want to start becoming a Scaled Agile Coach after completing any of these career paths, that is when you look to do the SAFe SPC.\"','safe4 certificate','','inherit','closed','closed','','39-revision-v1','','','2019-11-25 04:24:41','2019-11-25 04:24:41','',39,'http://trendingagile.justcodeindia.com/2019/11/25/39-revision-v1/',0,'revision','',0),(146,1,'2019-11-26 02:53:46','2019-11-26 02:53:46','Scrum is an agile methodology used by teams to streamline their change process. A Scrum Master is a member of the team in this methodology and it is their job to ensure the team is aligned to the Scrum practice. Their goal is to maximize value given and provided by the team. This includes fostering a sense of collaboration and cooperation to contribute to the synergy of all the team members which in turn will support their strategic and integrated approach to the team.','Scrum Master Certification','','publish','closed','closed','','scrum-master-certification','','','2020-03-05 09:01:56','2020-03-05 09:01:56','',0,'http://trendingagile.justcodeindia.com/?page_id=146',0,'page','',0),(147,1,'2019-11-26 02:53:46','2019-11-26 02:53:46','','Scrum Master Certification','','inherit','closed','closed','','146-revision-v1','','','2019-11-26 02:53:46','2019-11-26 02:53:46','',146,'http://trendingagile.justcodeindia.com/2019/11/26/146-revision-v1/',0,'revision','',0),(148,1,'2019-11-26 02:54:59','2019-11-26 02:54:59','','Home','','inherit','closed','closed','','8-revision-v1','','','2019-11-26 02:54:59','2019-11-26 02:54:59','',8,'http://trendingagile.justcodeindia.com/2019/11/26/8-revision-v1/',0,'revision','',0),(149,1,'2019-11-26 02:58:41','2019-11-26 02:58:41','<h2>Prove Your Scrum Knowledge and Get Certified</h2>\nThe Professional Scrum MasterTM level I (PSM I) assessment is available to anyone who wishes to validate his or her depth of knowledge of the PictureScrum framework and its application. Those who pass the assessment will receive the industry recognized PSM I Certification to demonstrate their fundamental level of Scrum mastery.\n\n<img class=\"size-full wp-image-150 alignleft\" src=\"http://www.trendingagile.com/wp-content/uploads/2019/11/ScrumMasterAssessment_Boarder.jpg\" alt=\"\" width=\"220\" height=\"220\" />Taking a course is not required and if you feel that you already possess a high level of Scrum knowledge, understanding of the Scrum Guide and how to apply Scrum within Scrum Teams, you have the option to take the PSM I assessment directly. However, there are courses available to help you prepare for the assessment and gain a stronger understanding of Scrum. Depending on your role, either the 2-day Professional Scrum Foundations or Professional Scrum Master course is highly recommended.\n\n&nbsp;\n\n&nbsp;\n<h3>Prepare for the Assessment</h3>\nThe assessment is difficult; preparation isrequired to achieve a passing score. Reading the Scrum Guide and taking the Open Assessments alone isn\'t typically enough preparation and we recommend reviewing the content below:\n<ul>\n 	<li>The assessment covers topics from multiple Focus Areas defined bythe<a href=\"https://www.scrum.org/professional-scrum-competencies\">Professional Scrum Competencies</a>.</li>\n 	<li>Many questions ask you to think about or interpret the meaning from the<a href=\"https://www.scrum.org/resources/scrum-guide\">Scrum Guide</a>and how you would apply Scrum within a Scrum Team.</li>\n 	<li>The<a href=\"https://www.scrum.org/resources/suggested-reading-professional-scrum-master\">PSM I Suggested Reading</a>lists the Focus Areas from which questions may be selected during the assessment.</li>\n 	<li>The<a href=\"https://www.scrum.org/pathway/scrum-master\">Scrum Master Learning Path</a>contains many additional resources to help you prepare to take the PSM I Assessment.</li>\n</ul>\nSearch the list of existing Professional Scrum certificationholders<a id=\"\" title=\"\" href=\"https://www.scrum.org/certification-list\" target=\"\" rel=\"noopener noreferrer\">here</a>or<a href=\"https://www.scrum.org/professional-scrum-certifications/count\">see</a>a breakdown on how many people hold certifications.\n\nTo protect the integrity of the certification process, Scrum.org does not share information about the specific questions that were answered correctly or incorrectly.<a href=\"https://www.scrum.org/support/what-do-professional-level-assessment-results-include\">Learn More</a>\n\nThe cost of PSM I is $150 USD.Assessment passwords do not expire and remain valid until used.<a href=\"https://www.scrum.org/professional-scrum-master-i-certification#Details\">See</a>below for more details.','Scrum Master Certification','','inherit','closed','closed','','146-autosave-v1','','','2019-11-26 02:58:41','2019-11-26 02:58:41','',146,'http://trendingagile.justcodeindia.com/2019/11/26/146-autosave-v1/',0,'revision','',0),(150,1,'2019-11-26 02:57:20','2019-11-26 02:57:20','','ScrumMasterAssessment_Boarder','','inherit','open','closed','','scrummasterassessment_boarder','','','2019-11-26 02:57:20','2019-11-26 02:57:20','',146,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/11/ScrumMasterAssessment_Boarder.jpg',0,'attachment','image/jpeg',0),(151,1,'2019-11-26 02:57:38','2019-11-26 02:57:38','<h2>Prove Your Scrum Knowledge and Get Certified</h2>\r\nThe Professional Scrum MasterTM level I (PSM I) assessment is available to anyone who wishes to validate his or her depth of knowledge of the PictureScrum framework and its application. Those who pass the assessment will receive the industry recognized PSM I Certification to demonstrate their fundamental level of Scrum mastery.\r\n\r\n<img class=\"size-full wp-image-150 alignleft\" src=\"http://www.trendingagile.com/wp-content/uploads/2019/11/ScrumMasterAssessment_Boarder.jpg\" alt=\"\" width=\"220\" height=\"220\" />Taking a course is not required and if you feel that you already possess a high level of Scrum knowledge, understanding of the Scrum Guide and how to apply Scrum within Scrum Teams, you have the option to take the PSM I assessment directly. However, there are courses available to help you prepare for the assessment and gain a stronger understanding of Scrum. Depending on your role, either the 2-day Professional Scrum Foundations or Professional Scrum Master course is highly recommended.','Scrum Master Certification','','inherit','closed','closed','','146-revision-v1','','','2019-11-26 02:57:38','2019-11-26 02:57:38','',146,'http://trendingagile.justcodeindia.com/2019/11/26/146-revision-v1/',0,'revision','',0),(152,1,'2019-11-26 02:58:45','2019-11-26 02:58:45','<h2>Prove Your Scrum Knowledge and Get Certified</h2>\r\nThe Professional Scrum MasterTM level I (PSM I) assessment is available to anyone who wishes to validate his or her depth of knowledge of the PictureScrum framework and its application. Those who pass the assessment will receive the industry recognized PSM I Certification to demonstrate their fundamental level of Scrum mastery.\r\n\r\n<img class=\"size-full wp-image-150 alignleft\" src=\"http://www.trendingagile.com/wp-content/uploads/2019/11/ScrumMasterAssessment_Boarder.jpg\" alt=\"\" width=\"220\" height=\"220\" />Taking a course is not required and if you feel that you already possess a high level of Scrum knowledge, understanding of the Scrum Guide and how to apply Scrum within Scrum Teams, you have the option to take the PSM I assessment directly. However, there are courses available to help you prepare for the assessment and gain a stronger understanding of Scrum. Depending on your role, either the 2-day Professional Scrum Foundations or Professional Scrum Master course is highly recommended.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n<h3>Prepare for the Assessment</h3>\r\nThe assessment is difficult; preparation isrequired to achieve a passing score. Reading the Scrum Guide and taking the Open Assessments alone isn\'t typically enough preparation and we recommend reviewing the content below:\r\n<ul>\r\n 	<li>The assessment covers topics from multiple Focus Areas defined bythe<a href=\"https://www.scrum.org/professional-scrum-competencies\">Professional Scrum Competencies</a>.</li>\r\n 	<li>Many questions ask you to think about or interpret the meaning from the<a href=\"https://www.scrum.org/resources/scrum-guide\">Scrum Guide</a>and how you would apply Scrum within a Scrum Team.</li>\r\n 	<li>The<a href=\"https://www.scrum.org/resources/suggested-reading-professional-scrum-master\">PSM I Suggested Reading</a>lists the Focus Areas from which questions may be selected during the assessment.</li>\r\n 	<li>The<a href=\"https://www.scrum.org/pathway/scrum-master\">Scrum Master Learning Path</a>contains many additional resources to help you prepare to take the PSM I Assessment.</li>\r\n</ul>\r\nSearch the list of existing Professional Scrum certificationholders<a id=\"\" title=\"\" href=\"https://www.scrum.org/certification-list\" target=\"\" rel=\"noopener noreferrer\">here</a>or<a href=\"https://www.scrum.org/professional-scrum-certifications/count\">see</a>a breakdown on how many people hold certifications.\r\n\r\nTo protect the integrity of the certification process, Scrum.org does not share information about the specific questions that were answered correctly or incorrectly.<a href=\"https://www.scrum.org/support/what-do-professional-level-assessment-results-include\">Learn More</a>\r\n\r\nThe cost of PSM I is $150 USD.Assessment passwords do not expire and remain valid until used.<a href=\"https://www.scrum.org/professional-scrum-master-i-certification#Details\">See</a>below for more details.','Scrum Master Certification','','inherit','closed','closed','','146-revision-v1','','','2019-11-26 02:58:45','2019-11-26 02:58:45','',146,'http://trendingagile.justcodeindia.com/2019/11/26/146-revision-v1/',0,'revision','',0),(153,1,'2019-11-26 02:59:17','2019-11-26 02:59:17','<h2>Prove Your Scrum Knowledge and Get Certified</h2>\r\nThe Professional Scrum MasterTM level I (PSM I) assessment is available to anyone who wishes to validate his or her depth of knowledge of the PictureScrum framework and its application. Those who pass the assessment will receive the industry recognized PSM I Certification to demonstrate their fundamental level of Scrum mastery.\r\n\r\n<img class=\"size-full wp-image-150 alignleft\" src=\"http://www.trendingagile.com/wp-content/uploads/2019/11/ScrumMasterAssessment_Boarder.jpg\" alt=\"\" width=\"220\" height=\"220\" />Taking a course is not required and if you feel that you already possess a high level of Scrum knowledge, understanding of the Scrum Guide and how to apply Scrum within Scrum Teams, you have the option to take the PSM I assessment directly. However, there are courses available to help you prepare for the assessment and gain a stronger understanding of Scrum. Depending on your role, either the 2-day Professional Scrum Foundations or Professional Scrum Master course is highly recommended.\r\n\r\n<h3>Prepare for the Assessment</h3>\r\nThe assessment is difficult; preparation isrequired to achieve a passing score. Reading the Scrum Guide and taking the Open Assessments alone isn\'t typically enough preparation and we recommend reviewing the content below:\r\n<ul>\r\n 	<li>The assessment covers topics from multiple Focus Areas defined bythe<a href=\"https://www.scrum.org/professional-scrum-competencies\">Professional Scrum Competencies</a>.</li>\r\n 	<li>Many questions ask you to think about or interpret the meaning from the<a href=\"https://www.scrum.org/resources/scrum-guide\">Scrum Guide</a>and how you would apply Scrum within a Scrum Team.</li>\r\n 	<li>The<a href=\"https://www.scrum.org/resources/suggested-reading-professional-scrum-master\">PSM I Suggested Reading</a>lists the Focus Areas from which questions may be selected during the assessment.</li>\r\n 	<li>The<a href=\"https://www.scrum.org/pathway/scrum-master\">Scrum Master Learning Path</a>contains many additional resources to help you prepare to take the PSM I Assessment.</li>\r\n</ul>\r\nSearch the list of existing Professional Scrum certificationholders<a id=\"\" title=\"\" href=\"https://www.scrum.org/certification-list\" target=\"\" rel=\"noopener noreferrer\">here</a>or<a href=\"https://www.scrum.org/professional-scrum-certifications/count\">see</a>a breakdown on how many people hold certifications.\r\n\r\nTo protect the integrity of the certification process, Scrum.org does not share information about the specific questions that were answered correctly or incorrectly.<a href=\"https://www.scrum.org/support/what-do-professional-level-assessment-results-include\">Learn More</a>\r\n\r\nThe cost of PSM I is $150 USD.Assessment passwords do not expire and remain valid until used.<a href=\"https://www.scrum.org/professional-scrum-master-i-certification#Details\">See</a>below for more details.','Scrum Master Certification','','inherit','closed','closed','','146-revision-v1','','','2019-11-26 02:59:17','2019-11-26 02:59:17','',146,'http://trendingagile.justcodeindia.com/2019/11/26/146-revision-v1/',0,'revision','',0),(154,1,'2019-11