. A Scrum Master is a member of the team in this methodology and it is their job to ensure the team is aligned to the Scrum practice. Their goal is to maximize value given and provided by the team. This includes fostering a sense of collaboration and cooperation to contribute to the synergy of all the team members which in turn will support their strategic and integrated approach to the team.','Scrum Master Certification','','inherit','closed','closed','','146-revision-v1','','','2019-12-02 02:56:08','2019-12-02 02:56:08','',146,'http://trendingagile.justcodeindia.com/2019/12/02/146-revision-v1/',0,'revision','',0),(189,1,'2019-12-02 02:56:30','2019-12-02 02:56:30','','Home','','inherit','closed','closed','','8-revision-v1','','','2019-12-02 02:56:30','2019-12-02 02:56:30','',8,'http://trendingagile.justcodeindia.com/2019/12/02/8-revision-v1/',0,'revision','',0),(190,1,'2019-12-02 03:13:23','2019-12-02 03:13:23','','Home','','publish','closed','closed','','home-2','','','2019-12-02 03:13:23','2019-12-02 03:13:23','',0,'http://trendingagile.justcodeindia.com/?p=190',1,'nav_menu_item','',0),(191,1,'2019-12-02 03:13:23','2019-12-02 03:13:23','','About us','','publish','closed','closed','','about-us-2','','','2019-12-02 03:13:23','2019-12-02 03:13:23','',0,'http://trendingagile.justcodeindia.com/?p=191',2,'nav_menu_item','',0),(192,1,'2019-12-02 03:13:23','2019-12-02 03:13:23','','Certificate','','publish','closed','closed','','certificate-2','','','2019-12-02 03:13:23','2019-12-02 03:13:23','',0,'http://trendingagile.justcodeindia.com/?p=192',3,'nav_menu_item','',0),(193,1,'2019-12-02 03:13:23','2019-12-02 03:13:23','','Contact Us','','publish','closed','closed','','contact-us-2','','','2019-12-02 03:13:23','2019-12-02 03:13:23','',0,'http://trendingagile.justcodeindia.com/?p=193',4,'nav_menu_item','',0),(196,1,'2019-12-05 01:49:43','2019-12-05 01:49:43','<div>The Project Management Professional Certification is currently the gold standard for companies all over the wo