ont-size: 10px;\n}\n}','trending-agile','','inherit','closed','closed','','163-revision-v1','','','2019-12-09 02:15:18','2019-12-09 02:15:18','',163,'http://trendingagile.justcodeindia.com/2019/12/09/163-revision-v1/',0,'revision','',0),(226,1,'2019-12-09 02:54:57','2019-12-09 02:54:57','The Certified SAFe DevOps Practitioner is responsible for the flow of the project from idea to the eventual solution delivery. They are work on improving the flow in a Continuous Delivery line. They also work and assist with Continuous Deployment, Continuous Integration, Continuous Exploration along with Release-on-Demand for the project. They work with the team to build a culture of shared responsibility among all.\r\n\r\nOur 2-day course will prepare you by having you understand the principles of SAFe CALMR (Culture, Automation, Lean, Measure and Recover) and apply them to the DevOps plan.','<span>SAFe<sup></sup></span> DevOps Practitioner (SDP)','','publish','closed','closed','','safe-devops-practitioner-sdp','','','2020-03-05 09:59:15','2020-03-05 09:59:15','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=226',0,'certified','',0),(227,1,'2019-12-09 02:46:21','2019-12-09 02:46:21','','cert_mark_SDP_badge','','inherit','open','closed','','cert_mark_sdp_badge','','','2019-12-09 02:46:21','2019-12-09 02:46:21','',226,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_SDP_badge.png',0,'attachment','image/png',0),(228,1,'2019-12-09 02:59:52','2019-12-09 02:59:52','A SAFe Government Practitioner is a team member that applies the principles and processes of SAFe to an Agile Release Train to maximize the value released in a government agency. They are responsible for leading the Lean transformation of a program or a project within the government agency.\r\n\r\nOur course prepares you by providing you with the in-depth understanding of the Lean-Agile mindset within a Release Train and how it can be managed across different teams and to align all of them to program goal. We also provide examples of various implementations within agencies so you are prepared with different patterns to suit your team.','<span>SAFe<sup></sup></span> Government Practitioner (SGP)','','publish','closed','closed','','safe-government-practitioner-sgp','','','2019-12-09 02:59:52','2019-12-09 02:59:52','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=228',0,'certified','',0),(229,1,'2019-12-09 02:59:33','2019-12-09 02:59:33','','cert_mark_SGP_badge','','inherit','open','closed','','cert_mark_sgp_badge','','','2019-12-09 02:59:33','2019-12-09 02:59:33','',228,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_SGP_badge.png',0,'attachment','image/png',0),(230,1,'2019-12-09 03:03:09','2019-12-09 03:03:09','The SAFe Agile Software Engineer is an evolving role. Starting with Agile and DevOps principles along with the addition of Lean principles, the role requires the person to deliver software solutions at a faster rate and with an increase in quality. This course is not limited to just software engineers or developers; any specialists within the software development team is encouraged to understand the knowledge and gain the skills that will enable Continuous Deployment or Continuous Delivery while increasing quality of the work.\r\n\r\nThe 3-day Agile Software Engineer course is designed for all the technical members of the software development team that emphasizes on various modern principles of programming such as Test Driven Development, Behavioral Driven Development etc. so you are better prepared to help the team grow and deliver better solutions faster.','<span>SAFe<sup></sup></span> Agile Software Engineer (ASE)','','publish','closed','closed','','safe-agile-software-engineer-ase','','','2020-03-05 09:27:40','2020-03-05 09:27:40','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=230',0,'certified','',0),(270,1,'2020-03-05 09:48:24','2020-03-05 09:48:24','','download','','inherit','open','closed','','download','','','2020-03-05 09:48:24','2020-03-05 09:48:24','',235,'https://www.trendingagile.com/wp-content/uploads/2019/12/download.png',0,'attachment','image/png',0),(232,1,'2019-12-09 03:04:29','2019-12-09 03:04:29','SAFe Architects is meant for those who via collaboration provide architectural solutions to the organization across various areas. Architects are responsible for enabling the Continuous Value Flow in the project and contribute to further the Lean-Agile mindset of the enterprise.\r\n\r\nOur course takes you behind the mind of a SAFe Architect and how they strive to align their solutions to the business value of the enterprise while keeping the system of systems on track.','<span>SAFe<sup></sup></span> for Architects (ARCH)','','publish','closed','closed','','safe-for-architects-arch','','','2019-12-09 03:07:04','2019-12-09 03:07:04','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=232',0,'certified','',0),(233,1,'2019-12-09 03:05:51','2019-12-09 03:05:51','SAFe Architects is meant for those who via collaboration provide architectural solutions to the organization across various areas. Architects are responsible for enabling the Continuous Value Flow in the project and contribute to further the Lean-Agile mindset of the enterprise.','<span>SAFe<sup></sup></span> for Architects (ARCH)','','inherit','closed','closed','','232-autosave-v1','','','2019-12-09 03:05:51','2019-12-09 03:05:51','',232,'http://trendingagile.justcodeindia.com/2019/12/09/232-autosave-v1/',0,'revision','',0),(234,1,'2019-12-09 03:06:49','2019-12-09 03:06:49','','cert_mark_ARCH_badge_vector-02','','inherit','open','closed','','cert_mark_arch_badge_vector-02','','','2019-12-09 03:06:49','2019-12-09 03:06:49','',232,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_ARCH_badge_vector-02.png',0,'attachment','image/png',0),(235,1,'2019-12-09 03:10:53','2019-12-09 03:10:53','The SAFe Lean Portfolio Manager is responsible for understanding and applying Agile Portfolio Operations along with Lean Governance to establish and implement a better Lean Portfolio Management functionality.\r\n\r\nThis course arms with the tools and the skills required to implement the Strategy and Investment Funding aspect of Portfolio Management while also giving you the techniques to identify important initiatives within the business side for better future delivery. After this course, you will be able to apply all the knowledge and the techniques to streamline and prioritize all the project initiatives for maximum economic and enterprise benefit.','<span>SAFe<sup></sup></span> Lean Portfolio Management (LPM)','','publish','closed','closed','','safe-lean-portfolio-management-lpm','','','2020-03-05 09:48:46','2020-03-05 09:48:46','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=235',0,'certified','',0),(236,1,'2019-12-09 03:10:36','2019-12-09 03:10:36','','cert_mark_LPM_badge_Large_600px','','inherit','open','closed','','cert_mark_lpm_badge_large_600px','','','2019-12-09 03:10:36','2019-12-09 03:10:36','',235,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_LPM_badge_Large_600px.png',0,'attachment','image/png',0),(237,1,'2019-12-09 03:14:36','2019-12-09 03:14:36','The SAFe Agile Product and Solution Manager combines Agile techniques with Design Thinking to generate better products and solutions for the enterprise. This course will develop your thinking process to enable you to design products and solutions that are:\r\n<ol>\r\n 	<li>Desirable (What Customers Want)</li>\r\n 	<li>Viable (Profitable for you)</li>\r\n 	<li>Feasible (Realistic goals and delivery)</li>\r\n 	<li>Sustainable (Manageable and reaches maximum ROI)</li>\r\n</ol>\r\nYou will also understand how the vision, strategy and roadmap are important to the organization and how they are used for new markets. Along with this, you will also learn about Continuous Exploration and how to utilize it to its max so you can innovate more.','<span>SAFe<sup></sup></span> Agile Product and Solution Management (APSM)','','publish','closed','closed','','safe-agile-product-and-solution-management-apsm','','','2019-12-09 03:14:36','2019-12-09 03:14:36','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=237',0,'certified','',0),(238,1,'2019-12-09 03:14:20','2019-12-09 03:14:20','','cert_mark_APSM_badge','','inherit','open','closed','','cert_mark_apsm_badge','','','2019-12-09 03:14:20','2019-12-09 03:14:20','',237,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_APSM_badge.png',0,'attachment','image/png',0),(239,1,'2019-12-09 03:18:27','2019-12-09 03:18:27','The SAFe SA course provides a well grounded and sound foundation in the Scaled Agile Framework. It provides the basic know how of the SAFe skills, knowledge set and mindset that one must follow in the growing world of Scaled Agile. At the end of this two day course, you will be eligible to take the SAFe Certification exam to obtain your SAFe Agilist (SA) Certification.\r\n\r\nThe two day certification training will also arm you with Scaled Agile concepts that you can implement in your day to day tasks and within your own team as well. You will learn how to define what constitutes a project and apply the concepts effectively. Our training will ensure that you understand how the team ties into the Project which in turn ties into the Program and the overall impact on the Portfolio, along with how Scaled Agile improves Productivity by applying Lean, Agile and Product Development ideologies.','<span>SAFe<sup></sup></span> Agilist','','publish','closed','closed','','safe-agilist','','','2020-03-05 09:46:15','2020-03-05 09:46:15','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=239',0,'certified','',0),(269,1,'2020-03-05 09:45:52','2020-03-05 09:45:52','','download (1)','','inherit','open','closed','','download-1','','','2020-03-05 09:45:52','2020-03-05 09:45:52','',239,'https://www.trendingagile.com/wp-content/uploads/2019/12/download-1.png',0,'attachment','image/png',0),(241,1,'2019-12-09 03:21:11','2019-12-09 03:21:11','The SAFe SP certification is for all team members to form a good understanding of Agile and Agile practices. It is a good to have certification especially for senior level positions and for senior management as it provides insight in developing a team of project managers, scrum masters, developers and testers. From another management perspective, this course and certification teach you how to scale a team with the highest level of impact to meet project goals, portfolio goals and the overall corporate goal.','<span>SAFe<sup></sup></span> Practitioner','','publish','closed','closed','','safe-practitioner','','','2019-12-09 03:21:11','2019-12-09 03:21:11','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=241',0,'certified','',0),(242,1,'2019-12-09 03:20:31','2019-12-09 03:20:31','','cert_mark_SP_badge','','inherit','open','closed','','cert_mark_sp_badge-2','','','2019-12-09 03:20:31','2019-12-09 03:20:31','',241,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_SP_badge.png',0,'attachment','image/png',0),(243,1,'2019-12-09 03:23:24','2019-12-09 03:23:24','The Scrum Master is the servant leader of the team. They strive to do everything for the team and promote Agile practices within it. A SAFe Scrum Master will do everything for the team, program and the enterprise in the servant leader role while still enforcing the Scrum principles.\r\n\r\nIf you are new to being a Scrum Master or already an experienced Scrum Master that wants to introduce Scaled Agile practices to their team, then this is the certification to start with.','<span>SAFe<sup></sup></span> Scrum Master','','publish','closed','closed','','safe-scrum-master','','','2020-03-05 09:54:35','2020-03-05 09:54:35','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=243',0,'certified','',0),(244,1,'2019-12-09 03:23:10','2019-12-09 03:23:10','','cert_mark_SSM_badge','','inherit','open','closed','','cert_mark_ssm_badge','','','2019-12-09 03:23:10','2019-12-09 03:23:10','',243,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_SSM_badge.png',0,'attachment','image/png',0),(245,1,'2019-12-09 03:26:00','2019-12-09 03:26:00','The Advanced Scrum Master certification is for existing Scrum Masters who now want to look a the bigger picture and promote cross functional teams and enable cross team communication to further establish Lean and Agile Principles.\r\n\r\nThe Advanced Scrum Master certification is for those who are looking to eventually reach the SAFe RTE level and start managing the Release Train. The ASM certification prepares you look and improve the team\'s established Release Train. Scrum, Kanban and XP are also covered in the course classes.','<span>SAFe<sup></sup></span> Advanced Scrum Master','','publish','closed','closed','','safe-advanced-scrum-master','','','2020-03-05 09:57:00','2020-03-05 09:57:00','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=245',0,'certified','',0),(246,1,'2019-12-09 03:25:44','2019-12-09 03:25:44','','cert_mark_SASM_badge','','inherit','open','closed','','cert_mark_sasm_badge','','','2019-12-09 03:25:44','2019-12-09 03:25:44','',245,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_SASM_badge.png',0,'attachment','image/png',0),(247,1,'2019-12-09 03:28:11','2019-12-09 03:28:11','For Business Analysts, Product Manager and Product Owners, the SAFe POPM certification prepares you to understand your role in delivering a team\'s worth to its fullest. You will gain the skillset and know-how of all the tools and processes of creating and handling Epics, managing backlogs, writing stories and planning their execution in each iteration.\r\n\r\nThe training for the certification will build you a foundation in Epics, Features and Stories along with Backlog Refinements, Process Improvements, how to evolve stories as projects change, plan and execute iterations, CI/CD for software, handling DevOps and then overall blend the Product Owner/Manager seamlessly in the Release Train. (Please note that a SAFe SA, SP course is recommended as a prerequisite for this course)','<span>SAFe<sup></sup></span> Product Owner / Product Manager','','publish','closed','closed','','safe-product-owner-product-manager','','','2020-03-05 09:52:20','2020-03-05 09:52:20','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=247',0,'certified','',0),(248,1,'2019-12-09 03:27:56','2019-12-09 03:27:56','','cert_mark_POPM_badge','','inherit','open','closed','','cert_mark_popm_badge','','','2019-12-09 03:27:56','2019-12-09 03:27:56','',247,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_POPM_badge.png',0,'attachment','image/png',0),(249,1,'2019-12-09 03:30:48','2019-12-09 03:30:48','A SAFe RTE is a servant leader like a Scrum Master but they exclusively deal with delivering the complete end to end value of the project in a Lean format. The RTE is responsible for the creation, management and execution of the Agile Release Train. They are responsible for enabling Agile processes, coaching the team in the new processes and mindset. They are also responsible for the Program Increment, its planning and alignment with the overall goal of the enterprise.\r\n\r\nThis course will enable you to understand the role and responsibilities that come with it. It is recommended that you have participated in at least one PI and one ART and that you have had a few months of experience as an RTE along with time spent working on cross team communications.','<span>SAFe<sup></sup></span> Release Train Engineer','','publish','closed','closed','','safe-release-train-engineer','','','2020-03-05 09:16:37','2020-03-05 09:16:37','',0,'http://trendingagile.justcodeindia.com/?post_type=certified&#038;p=249',0,'certified','',0),(250,1,'2019-12-09 03:30:32','2019-12-09 03:30:32','','cert_mark_RTE_badge','','inherit','open','closed','','cert_mark_rte_badge','','','2019-12-09 03:30:32','2019-12-09 03:30:32','',249,'http://trendingagile.justcodeindia.com/wp-content/uploads/2019/12/cert_mark_RTE_badge.png',0,'attachment','image/png',0),(251,1,'2019-12-09 03:56:17','2019-12-09 03:56:17','\"We at Trending Agile know that the world of SAFe and its multitude of certifications can be a tad difficult to handle. We know that you want the best for you without any diversions on your career path, which is why we have a roadmap here to make things easier for you. If you would like something more specific, you can always reach out to us and we will work with you to get you the best possible you that you can be.\r\n<br/><br/>\r\nP.S. Remember if you ever want to start becoming a Scaled Agile Coach after completing any of these career paths, that is when you look to do the SAFe SPC.\"','Scaled Agile Courses','','inherit','closed','closed','','39-revision-v1','','','2019-12-09 03:56:17','2019-12-09 03:56:17','',39,'http://trendingagile.justcodeindia.com/2019/12/09/39-revision-v1/',0,'revision','',0);
