INSERT INTO `ta_wfissues` VALUES (1,1601910797,1601910797,'ignoreC','wfPluginUpgrade',50,'09ee0eca0d8be07291a5accb4d4a75f1','09ee0eca0d8be07291a5accb4d4a75f1','The Plugin \"Advanced Custom Fields PRO\" needs an upgrade (5.8.3 -> 5.9.1).','You need to upgrade \"Advanced Custom Fields PRO\" to the newest version to ensure you have any security fixes the developer has released.','a:18:{s:4:\"Name\";s:26:\"Advanced Custom Fields PRO\";s:9:\"PluginURI\";s:36:\"https://www.advancedcustomfields.com\";s:7:\"Version\";s:5:\"5.8.3\";s:11:\"Description\";s:151:\"Customize WordPress with powerful, professional and intuitive fields. <cite>By <a href=\"https://www.advancedcustomfields.com\">Elliot Condon</a>.</cite>\";s:6:\"Author\";s:64:\"<a href=\"https://www.advancedcustomfields.com\">Elliot Condon</a>\";s:9:\"AuthorURI\";s:36:\"https://www.advancedcustomfields.com\";s:10:\"TextDomain\";s:3:\"acf\";s:10:\"DomainPath\";s:5:\"/lang\";s:7:\"Network\";b:0;s:10:\"RequiresWP\";s:0:\"\";s:11:\"RequiresPHP\";s:0:\"\";s:5:\"Title\";s:77:\"<a href=\"https://www.advancedcustomfields.com\">Advanced Custom Fields PRO</a>\";s:10:\"AuthorName\";s:13:\"Elliot Condon\";s:10:\"pluginFile\";s:105:\"/home/justcod1/public_html/trendingagile.com/wp-content/plugins/advanced-custom-fields-pro-master/acf.php\";s:10:\"newVersion\";s:5:\"5.9.1\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:5:\"wpURL\";s:36:\"https://www.advancedcustomfields.com\";s:10:\"vulnerable\";b:0;}'),(10,1601911101,1601911101,'ignoreP','skippedPaths',25,'6fd0d290b978eab8027e6b79501ac149','6fd0d290b978eab8027e6b79501ac149','5 paths were skipped for the malware scan due to scan settings','The option \"Scan files outside your WordPress installation\" is off by default, which means 5 paths and their file(s) will not be scanned for malware or unauthorized changes. To continue skipping these paths, you may ignore this issue. Or to start scanning them, enable the option and subsequent scans will include them. Some paths may not be necessary to scan, so this is optional. <a href=\"https://www.wordfence.com/help/?query=scan-result-skipped-paths\" target=\"_blank\" rel=\"noopener noreferrer\">Learn More</a><br><br>The paths skipped are ~/.quarantine, ~/.tmb, ~/1_installation, ~/nbproject, and ~/temp','a:0:{}'),(11,1601911160,1601911160,'ignoreC','wfPluginAbandoned',50,'bfae1f8dceadcee6d7a6b82aaf2eec12','bfae1f8dceadcee6d7a6b82aaf2eec12','The Plugin \"Contact Form 7 Newsletter\" appears to be abandoned (updated December 30, 2015, tested to WP 4.4.23).','It was last updated 4 years 9 months ago and tested up to WordPress 4.4.23. Plugins can be removed from wordpress.org for various reasons. This can include benign issues like a plugin author discontinuing development or moving the plugin distribution to their own site, but some might also be due to security issues. In any case, future updates may or may not be available, so it is worth investigating the cause and deciding whether to temporarily or permanently replace or remove the plugin. <a href=\"https://www.wordfence.com/help/?query=scan-result-plugin-abandoned\" target=\"_blank\" rel=\"noopener noreferrer\">Get more information.</a>','a:19:{s:4:\"name\";s:25:\"Contact Form 7 Newsletter\";s:4:\"slug\";s:25:\"contact-form-7-newsletter\";s:7:\"version\";s:3:\"2.2\";s:6:\"author\";s:68:\"<a href=\"http://www.katzwebservices.com\">Katz Web Services, Inc.</a>\";s:14:\"author_profile\";s:44:\"https://profiles.wordpress.org/katzwebdesign\";s:8:\"requires\";s:3:\"3.2\";s:6:\"tested\";s:6:\"4.4.23\";s:12:\"requires_php\";b:0;s:13:\"compatibility\";a:0:{}s:11:\"num_ratings\";i:24;s:15:\"support_threads\";i:1;s:24:\"support_threads_resolved\";i:0;s:12:\"last_updated\";s:21:\"2015-12-30 1:25am GMT\";s:8:\"homepage\";s:50:\"https://katz.co/plugins/contact-form-7-newsletter/\";s:13:\"download_link\";s:68:\"https://downloads.wordpress.org/plugin/contact-form-7-newsletter.zip\";s:11:\"dateUpdated\";s:17:\"December 30, 2015\";s:9:\"abandoned\";b:1;s:10:\"vulne